%pig
businessData = FOREACH a GENERATE (int)json#'review_count' as review_count,(double)json#'stars' as stars, json#'city' as city, json#'categories' as categories;
flattenedBusinessData = FOREACH businessData GENERATE review_count,stars, city, FLATTEN(categories);
groupedBusinessData = GROUP flattenedBusinessData BY (city,categories);
finalData = FOREACH groupedBusinessData GENERATE group.city as city , group.categories as category, AVG(flattenedBusinessData.review_count), AVG(flattenedBusinessData.stars);
dump finalData;

%pig
q2_3 = FOREACH a GENERATE (double)json#'stars' as stars, json#'city' as city, json#'state' as state, json#'categories' as categories;
q2_2 = FOREACH q2_3 GENERATE stars, city, state, FLATTEN(categories);
q2_1 = GROUP q2_2 BY (city,state,categories);
q2 = FOREACH q2_1 GENERATE group.city as city,group.state as state, group.categories as category, AVG(q2_2.stars);
dump q2;

%pig
q3_1 = FOREACH a GENERATE (double)json#'stars' as stars,json#'attributes' as attributes, json#'categories' as categories:bag{a:tuple(b:chararray)} ;
q3_2 = FOREACH q3_1 GENERATE stars as stars,FLATTEN(attributes#'RestaurantsTakeOut') as takeout, FLATTEN(categories) as categories;
q3_3 = FILTER q3_2 BY (categories=='Mexican') AND (takeout matches '.*true.*');
q3_4 = GROUP q3_3 BY (takeout,categories);
q3 = FOREACH q3_4 GENERATE group.takeout as takeout , group.categories as category, AVG(q3_3.stars);
dump q3;

%pig
q4_1 = FOREACH a GENERATE (double)json#'stars' as stars, json#'latitude' as latitude, json#'longitude' as longitude, (double)json#'review_count' as reviews, json#'categories' as categories:bag{a:tuple(b:chararray)} ;
q4_2 = FOREACH q4_1 GENERATE stars,latitude,longitude,reviews, FLATTEN(categories) as categories;

%pig
q4_3 = FOREACH q4_2 GENERATE *, (111.045* org.apache.pig.piggybank.evaluation.math.toDegrees(ACOS(COS(org.apache.pig.piggybank.evaluation.math.toRadians(43.6532))* COS(org.apache.pig.piggybank.evaluation.math.toRadians(latitude))* COS(org.apache.pig.piggybank.evaluation.math.toRadians(-79.3832) - org.apache.pig.piggybank.evaluation.math.toRadians(longitude))+ SIN(org.apache.pig.piggybank.evaluation.math.toRadians(43.6532))* SIN(org.apache.pig.piggybank.evaluation.math.toRadians(latitude))))) as distance:double;
q4_4 = FILTER q4_3 BY (distance<15);
q4_5 = GROUP q4_4 BY categories;
q4 = FOREACH q4_5 GENERATE group as category, AVG(q4_4.stars), AVG(q4_4.reviews);
dump q4;

%pig
q5_1 = FOREACH a GENERATE (double)json#'stars' as stars,json#'business_id' as id, json#'latitude' as latitude, json#'longitude' as longitude, json#'categories' as categories:bag{a:tuple(b:chararray)} ;
q5_2 = FOREACH q5_1 GENERATE stars,id,latitude,longitude, FLATTEN(categories) as categories;
q5_3 = FOREACH q5_2 GENERATE *, (111.045* org.apache.pig.piggybank.evaluation.math.toDegrees(ACOS(COS(org.apache.pig.piggybank.evaluation.math.toRadians(43.6532))* COS(org.apache.pig.piggybank.evaluation.math.toRadians(latitude))* COS(org.apache.pig.piggybank.evaluation.math.toRadians(-79.3832) - org.apache.pig.piggybank.evaluation.math.toRadians(longitude))+ SIN(org.apache.pig.piggybank.evaluation.math.toRadians(43.6532))* SIN(org.apache.pig.piggybank.evaluation.math.toRadians(latitude))))) as distance:double;
q5_4 = FILTER q5_3 BY (distance<15) AND (categories=='Food');
q5_5 = GROUP q5_4 BY id;
q5_6 = FOREACH q5_5 GENERATE group as id, AVG(q5_4.stars) as stars;
dump q5_6;

%pig
q5_top = ORDER q5_6 BY stars DESC;
top10 = limit q5_top 10;
dump top10;

%pig
q5_bottom= ORDER q5_6 BY stars ASC;
bottom10 = limit q5_bottom 10;
dump bottom10;

%pig
r = LOAD '/shared/d/yg/Downloads/dataset/review.json' USING com.twitter.elephantbird.pig.load.JsonLoader('-nestedLoad') as (json:map[]);
r1= FOREACH r GENERATE json#'stars' as stars,json#'business_id' as id, json#'date' as date;
top10bottom10 = UNION top10, bottom10;
dump top10bottom10;

%pig
joined_r = JOIN r1 by id, top10bottom10 by id;
final_required_Data = FOREACH joined_r GENERATE top10bottom10::id as bid, (double)r1::stars as star,SUBSTRING(r1::date,5,7) as month;
filtered_data_by_month = FILTER final_required_Data BY (month matches '01|02|03|04|05');
dump filtered_data_by_month;

%pig
grouped_data_by_business = GROUP filtered_data_by_month by bid;
avg_rating = FOREACH grouped_data_by_business GENERATE group, AVG(filtered_data_by_month.star) as avg_stars;
dump avg_rating;
